export default class Preload extends Phaser.Scene{

    platform;
    counter = 0;

    constructor()
    {
        super('preload')
    }

    preload()
    {
        this.platform = this;
        this.counter = 0;
    }

    create()
    {
        const loading_background_imageData = "data:image/webp;base64,"

        const loading_car1_imageData = "data:image/webp;base64,"

        const loading_car2_imageData = "data:image/webp;base64,"

        const loading_car3_imageData = "data:image/webp;base64,"

        const loading_car4_imageData = "data:image/webp;base64,"

        const loading_car1mini_imageData = "data:image/webp;base64,"

        const loading_car2mini_imageData = "data:image/webp;base64,"

        const loading_car3mini_imageData = "data:image/webp;base64,"

        const loading_car4mini_imageData = "data:image/webp;base64,"

        const loading_car1miniSelected_imageData = "data:image/webp;base64,"

        const loading_car2miniSelected_imageData = "data:image/webp;base64,"

        const loading_car3miniSelected_imageData = "data:image/webp;base64,"

        const loading_car4miniSelected_imageData = "data:image/webp;base64,"

        const loading_text_imageData = "data:image/webp;base64,"

        const loading_sun_imageData = "data:image/webp;base64,"

        const loading_logo_imageData = "data:image/webp;base64,"

        const loading_startButton_imageData = "data:image/webp;base64,"

        const blue_screen_imageData = "data:image/webp;base64,"

        const get_imageData = "data:image/webp;base64,"

        const set_imageData = "data:image/webp;base64,"

        const go_imageData = "data:image/webp;base64,"

        const game_background_imageData = "data:image/webp;base64,"

        const game_car1_imageData = "data:image/webp;base64,"

        const game_car2_imageData = "data:image/webp;base64,"

        const game_car3_imageData = "data:image/webp;base64,"

        const game_car4_imageData = "data:image/webp;base64,"

        const game_dividerSingle_imageData = "data:image/webp;base64,"

        const game_progress_imageData = "data:image/webp;base64,"

        const game_car1mini_imageData = "data:image/webp;base64,"

        const game_car2mini_imageData = "data:image/webp;base64,"

        const game_car3mini_imageData = "data:image/webp;base64,"

        const game_car4mini_imageData = "data:image/webp;base64,"

        const game_stering_imageData = "data:image/webp;base64,"

        const game_arrows_imageData = "data:image/webp;base64,"

        const game_clouds_imageData = "data:image/webp;base64,"

        const game_coin_imageData = "data:image/webp;base64,"

        const game_msg1_imageData = "data:image/webp;base64,"

        const game_msg2_imageData = "data:image/webp;base64,"
        
        const game_msg3_imageData = "data:image/webp;base64,"

        const game_msg4_imageData = "data:image/webp;base64,"

        const game_msg5_imageData = "data:image/webp;base64,"

        const game_msg6_imageData = "data:image/webp;base64,"

        const game_msg7_imageData = "data:image/webp;base64,"

        const game_crashAnim1_imageData = "data:image/webp;base64,"

        const game_crashAnim2_imageData = "data:image/webp;base64,"
        
        const game_crashAnim3_imageData = "data:image/webp;base64,"

        const game_finishLine_imageData = "data:image/webp;base64,"

        const game_serviceCenter_imageData = "data:image/webp;base64,"

        const final_background_imageData = "data:image/webp;base64,"

        const final_road_imageData = "data:image/webp;base64,"

        const final_wonMsg_imageData = "data:image/webp;base64,"

        const final_bookNow_imageData = "data:image/webp;base64,"

        const final_lostMsg_imageData = "data:image/webp;base64,"

        const final_tryAgain_imageData = "data:image/webp;base64,"

        const background_audioData = "data:image/webp;base64,"

        const carSelected_audioData = "data:image/webp;base64,"

        const click_audioData = "data:image/webp;base64,"

        const coinCollected_audioData = "data:image/webp;base64,"

        const getSetGo_audioData = "data:image/webp;base64,"

        const lost_audioData = "data:image/webp;base64,"

        const won_audioData = "data:image/webp;base64,"


        // loading
        this.platform.textures.addBase64('loading-background', loading_background_imageData)
        this.platform.textures.addBase64('loading-car1', loading_car1_imageData)
        this.platform.textures.addBase64('loading-car2', loading_car2_imageData)
        this.platform.textures.addBase64('loading-car3', loading_car3_imageData)
        this.platform.textures.addBase64('loading-car4', loading_car4_imageData)
        this.platform.textures.addBase64('loading-car1mini', loading_car1mini_imageData)
        this.platform.textures.addBase64('loading-car2mini', loading_car2mini_imageData)
        this.platform.textures.addBase64('loading-car3mini', loading_car3mini_imageData)
        this.platform.textures.addBase64('loading-car4mini', loading_car4mini_imageData)
        this.platform.textures.addBase64('loading-car1miniSelected', loading_car1miniSelected_imageData)
        this.platform.textures.addBase64('loading-car2miniSelected', loading_car2miniSelected_imageData)
        this.platform.textures.addBase64('loading-car3miniSelected', loading_car3miniSelected_imageData)
        this.platform.textures.addBase64('loading-car4miniSelected', loading_car4miniSelected_imageData)
        this.platform.textures.addBase64('loading-text', loading_text_imageData)
        this.platform.textures.addBase64('loading-sun', loading_sun_imageData)
        this.platform.textures.addBase64('loading-logo', loading_logo_imageData)
        this.platform.textures.addBase64('loading-startButton', loading_startButton_imageData)

        // splash
        this.platform.textures.addBase64('blueScreen', blue_screen_imageData)
        this.platform.textures.addBase64('get', get_imageData)
        this.platform.textures.addBase64('set', set_imageData)
        this.platform.textures.addBase64('go', go_imageData)

        // game
        this.platform.textures.addBase64('game-background', game_background_imageData)
        this.platform.textures.addBase64('game-car1', game_car1_imageData)
        this.platform.textures.addBase64('game-car2', game_car2_imageData)
        this.platform.textures.addBase64('game-car3', game_car3_imageData)
        this.platform.textures.addBase64('game-car4', game_car4_imageData)
        this.platform.textures.addBase64('game-dividerSingle', game_dividerSingle_imageData)
        this.platform.textures.addBase64('game-progress', game_progress_imageData)
        this.platform.textures.addBase64('game-car1mini', game_car1mini_imageData)
        this.platform.textures.addBase64('game-car2mini', game_car2mini_imageData)
        this.platform.textures.addBase64('game-car3mini', game_car3mini_imageData)
        this.platform.textures.addBase64('game-car4mini', game_car4mini_imageData)
        this.platform.textures.addBase64('game-stering', game_stering_imageData)
        this.platform.textures.addBase64('game-arrows', game_arrows_imageData)
        this.platform.textures.addBase64('game-clouds', game_clouds_imageData)
        this.platform.textures.addBase64('game-coin', game_coin_imageData)
        this.platform.textures.addBase64('game-msg1', game_msg1_imageData)
        this.platform.textures.addBase64('game-msg2', game_msg2_imageData)
        this.platform.textures.addBase64('game-msg3', game_msg3_imageData)
        this.platform.textures.addBase64('game-msg4', game_msg4_imageData)
        this.platform.textures.addBase64('game-msg5', game_msg5_imageData)
        this.platform.textures.addBase64('game-msg6', game_msg6_imageData)
        this.platform.textures.addBase64('game-msg7', game_msg7_imageData)
        this.platform.textures.addBase64('game-crashAnim1', game_crashAnim1_imageData)
        this.platform.textures.addBase64('game-crashAnim2', game_crashAnim2_imageData)
        this.platform.textures.addBase64('game-crashAnim3', game_crashAnim3_imageData)
        this.platform.textures.addBase64('game-finishLine', game_finishLine_imageData)
        this.platform.textures.addBase64('game-serviceCenter', game_serviceCenter_imageData)

        // won
        this.platform.textures.addBase64('final-background', final_background_imageData)
        this.platform.textures.addBase64('final-road', final_road_imageData)
        this.platform.textures.addBase64('final-wonMsg', final_wonMsg_imageData)
        this.platform.textures.addBase64('final-bookNow', final_bookNow_imageData)

        // lost
        this.platform.textures.addBase64('final-lostMsg', final_lostMsg_imageData)
        this.platform.textures.addBase64('final-tryAgain', final_tryAgain_imageData)

        // music
        this.platform.sound.decodeAudio('backgroundSound', background_audioData)
        this.platform.sound.decodeAudio('carSelected', carSelected_audioData)
        this.platform.sound.decodeAudio('click', click_audioData)
        this.platform.sound.decodeAudio('coinCollected', coinCollected_audioData)
        this.platform.sound.decodeAudio('getSetGo', getSetGo_audioData)
        this.platform.sound.decodeAudio('lost', lost_audioData)
        this.platform.sound.decodeAudio('won', won_audioData)



        this.platform.textures.on('onload', function() {
            this.counter += 1;
        }, this);

        this.platform.sound.on('decoded', function() {
            this.counter += 1;
        }, this);

        // Timer check when all based64 assets have been loaded
        this.platform.customTimer = this.platform.time.addEvent({ delay: 500, callback: function callback() {
            
            // Adjust counter maximum as you ecpect. For now just one based64 assets need to be loaded only
            if (this.counter === 61) {
            
                // Destroy timer to save memory
                this.platform.customTimer.remove(false);

                this.scene.start('loading-scene')
            }

        
        }, callbackScope: this.platform, loop: true}, this);
    }

}